// SpringAnimation.js
import React from 'react';
import './SpringAnimation.css';

const SpringAnimation = () => {
  const createFlowers = () => {
    const flowers = [];
    for (let i = 0; i < 30; i++) {
      const flowerStyle = {
        left: `${Math.random() * 100}vw`,
        top: `${Math.random() * 100}vh`,
        animationDuration: `${Math.random() * 3 + 3}s`,
        animationDelay: `${Math.random() * 3}s`,
      };
      flowers.push(<div className="flower" style={flowerStyle} key={i}></div>);
    }
    return flowers;
  };

  return <div className="spring-animation">{createFlowers()}</div>;
};

export default SpringAnimation;
